import React from "react";
import "./circularIconStyles.css";

class CircularIcon extends React.Component {
  constructor(props) {
    super(props);
    console.log(props);
  }
  render(props) {
    return (
      <div style = {styles.circleStyles}>
        <img src = {require("./../images/icons/" + this.props.type + "Icon.png").default} style = {styles.imageStyles}></img>
      </div>
    )
  }
}

export default CircularIcon;
